import React, { Fragment } from "react";
import "../Greeting/Greting.css";

const Greeting = ({ name }) => {
  return (
    <Fragment>
      <div>
        <h3>Hello {name}!</h3>
      </div>
    </Fragment>
  );
};

export default Greeting;
